import React from 'react';
import {Route, Link} from "react-router-dom";
import LoginPage from './Components/LoginPage.js';

const Home = props => {
    return (
        <div>
        <h1>Welcome</h1>
        <Link to="/LoginPage">Login Page</Link>
        <Route path="/login" component={LoginPage}/>
        </div>
    )
}

export default Home;
